{{Infobox sportsperson | name = Eva Pereira | image = | image_size = | alt = | caption = | fullname = Eva Sanches Pereira | nickname = | nationality = [[Cape Verde]]an | birth_date = {{birth date and age|1989|03|22}}<ref name="IAAF">{{cite web|title=Profile of Eva Pereira|url=http://www.iaaf.org/athletes/cape-verde-islands/eva-pereira-208020|publisher=[[International Association of Athletics Federations|IAAF]]|accessdate=3 January 2014}}</ref> | birth_place = | residence = | education = | alma_mater = | years_active = | height = | weight = | country = [[Cape Verde]] | sport = [[Athletics (sport)|Athletics]] | event = [[middle-distance track event|middle-distances]] | collegeteam = | universityteam = | pb = | medaltemplates = | show-medals = | updated = 3 January 2014 }}
'''Eva Sanches Pereira''' (born 22 March 1989) is a [[Cape Verde]]an [[middle distance track event|middle distance runner]].
==Career== Pereira first competed for Cape Verde at the [[2005 World Youth Championships in Athletics]] in [[Marrakesh]], [[Morocco]] where she placed 15th in the [[2005 World Youth Championships in Athletics – Girls' 3000 metres|Girls' 3000 metres]] in a personal best time of 11:53.24. Two years later at the [[2009 Lusophony Games]] in [[Lisbon]], [[Portugal]] she placed 6th in the [[Athletics at the 2009 Lusophony Games – Results#10 kilometers 2|10,000 metres]] with a time of 44:56. The following month she ran the [[2009 World Championships in Athletics – Women's 1500 metres|1500 metres]] in 5:04.95 at the [[2009 World Championships in Athletics]] in [[Berlin]].
