{{Infobox station | name = Thanjavur | type = [[Indian Railways|Indian Railway]] [[Junction Station]] | style = Indian Railways | image = | image_size = | image_caption = | address =Gandhiji Road, Thanjavur-1, Tamilnadu | country = India | coordinates = {{Coord|10.7781|N|79.1381|E|type:railwaystation_region:IN|format=dms|display=inline,title}} | elevation = {{convert|60|m|ft}} | line = [[Chennai Egmore–Thanjavur line]] | structure = Standard on ground | platform = 5 | tracks = | entrances = | parking = Yes | bicycle = No | baggage_check = No | opened = | closed = | rebuilt = | electrified = | ADA = | code = {{Indian railway code | code = TJ | division = [[Tiruchirappalli Railway Division|Tiruchirappalli]] }} | owned = [[Indian Railways]] | operator = [[Southern Railway zone | Southern Railway]] | status = Functioning | former = | passengers = | pass_year = | pass_percent = | pass_system = | map_locator = {{Location map|India Tamil Nadu| lat=10.7781|long=79.1381| width=300|caption= Location in Tamilnadu|label='''Thanjavur''' railway station}} }} '''Thanjavur railway station''' is located in [[Thanjavur district]] in the [[India]]n [[States and territories of India|state]] of [[Tamilnadu]] and serves [[Thanjavur]], earlier known as Tanjore. ==Overview== Thanjavur was capital of the Chola kingdom from around 9th century to around 13th century, possibly with intermittent breaks. During this period many temples were built, some of which bear testimony to the finesse of South Indian architecture. As such, it is a place of pilgrimage and tourist interest.<ref>{{cite web| url = http://www.municipality.tn.gov.in/thanjavur/about-history.htm |title = Historical moments| publisher= Thanjavur municipality| accessdate = 3 January 2014}}</ref>
==History== Thanjavur is located on the "main line" of the railway system in the [[Coromandel coast]] connecting Chennai with Tiruchchirappalli via Villupuram, Cuddalore, Mayiladuthurai (Mayuram) and Thanjavur junctions.<ref>{{cite web| url= http://irfca.org/articles/metric/delta.html| title= Four Cauvery Delta Branches | publisher= IRFCA | accessdate = 3 January 2014}}</ref> In 1861 the Great Southern Railway of India built the {{convert|125|km|mi|0|abbr=on}} long {{RailGauge|1676}} wide [[Indian gauge|broad gauge]] line between Nagapatnam and Tiruchirapalli (then known as Trichinopoly) and the line was opened to traffic next year.<ref name=irfcai>{{cite web| url=http://www.irfca.org/faq/faq-hist.html| title=IR History: Early Days – I| work=Chronology of railways in India, Part 2 (1832 - 1865)| accessdate = 3 January 2014 }}</ref>It was a new development south of Chennai. After taking over of GSIR by [[South Indian Railway Company]] in 1874, the Nagapatnam-Tiruchirapalli line was converted to {{RailGauge|1000}} wide [[metre gauge]] in 1875.<ref name=irfcaii>{{cite web| url=http://www.irfca.org/faq/faq-history2.html| title=IR History: Early Days – II| work=Chronology of railways in India, Part 2 (1870 - 1899)| accessdate = 3 January 2014}}</ref>
The South India Railway Company laid a {{convert|715|km|mi|0|abbr=on}} long metre gauge trunk line from Chennai to Tuticorin via Kumbakonam and Thanjavur in 1880.<ref>{{cite web| url= http://www.hindu.com/mp/2004/12/18/stories/2004121800560100.htm| title=Chugging into the past| publisher= The Hindu, 18 December 2004 | accessdate = 3 January 2014 }}</ref>The {{convert|82.67|km|mi|0|abbr=on}} long Tindivanam-Cuddalore Port (then known as Cuddalore Junction) sector, {{convert|27.60|km|mi|0|abbr=on}} long Cuddalore Port-Porto Novo sector, {{convert|19.71|km|mi|0|abbr=on}} long Shyali-Mayiladuturai sector and {{convert|70.42|km|mi|0|abbr=on}} long Mayiladuturai-Thanjavur setor were opened in 1877, thereby connecting Tindivaram to the already opened Tiruchirappalli-Nagapattinam line.<ref name=timeline>{{cite web|last=R. P. Saxena|title=Indian Railway History Time line|url=http://irse.bravehost.com/IRHTML.htm|work=Irse.bravehost.com|accessdate=1 January 2014|archiveurl=http://archive.is/NcFN|archivedate=14 July 2012}}</ref>
==Gauge conversion== The Cuddalore Port-Vadalur sector was converted in 2003.<ref>{{cite web| url=http://www.hindu.com/2004/08/16/stories/2004081612410300.htm | title=Trichur rly division nets Rs. 23.77 cr. Passenger earnings | publisher= The Hindu, 16 August 2004 | accessdate = 30 December 2013 }}</ref>After conversion work of the Thanjavur-Tiruvarur broad gauge section was opened to traffic in 2006 and Tiruvarur-Nagore section in 2010..<ref>{{cite web| url= http://www.thehindu.com/news/cities/Tiruchirapalli/more-trains-in-pipeline-for-delta-districts-says-southern-railway-gm/article1469210.ece| title= More trains in pipeline for delta districts, says Southern Railway GM| publisher= The Hindu, 19 February 2011 | accessdate = 3 January 2014}}</ref>
==Electrification== New electrification survey in 2012-13 had been sanctioned in the Railway budget for the Karaikkal/Karaikkal port-Thiruvarur-Thanjavur-Tiruchchirappalli and Nagapattinam-Velankkani sectors.<ref>{{cite web| url = http://www.sr.indianrailways.gov.in/view_section.jsp?lang=0&id=0,6,746 |title = Specific items for Southern Railway in Railway Budget 2012-13|work= New Railway Electrification Surveys sanctioned in 2012-13| publisher= | accessdate = 3 January 2014}}</ref>
==Amenities== Thanjavur railway station has computerised reservation counters, waiting room, retiring room, vegetarian refreshment stall, tea stall and book stall.<ref>{{cite web| url = http://www.makemytrip.com/railways/thanjavur-tj-railway-station.html |title = Thanjavur railway station| publisher= Make my trip | accessdate = 3 January 2013}}</ref>
