{{Taxobox | image = | image_width = | image_caption = | regnum = [[Fungi]] | divisio = [[Ascomycota]] | subdivisio = [[Pezizomycotina]] | classis = [[Sordariomycetes]] | ordo = ''[[incertae sedis]]'' | familia = ''[[incertae sedis]]'' | genus = '''''Myrmecridium''''' | genus_authority = Arzanlou, W.Gams & Crous (2007) | type_species = ''Myrmecridium schulzeri'' | type_species_authority = ([[Sacc.]]) Arzanlou, W.Gams & Crous (2007) | subdivision_ranks = Species | subdivision = {{plainlist| *''[[Myrmecridium banksiae|M. banksiae]]'' *''[[Myrmecridium flexuosum|M. flexuosum]]'' *''[[Myrmecridium obovoideum|M. obovoideum]]''<ref name="Jiea 2013"/> *''[[Myrmecridium phragmitis|M. phragmitis]]'' *''[[Myrmecridium schulzeri|M. schulzeri]]'' *''[[Myrmecridium thailandicum|M. thailandicum]]'' }} }} '''''Myrmecridium''''' is a [[genus]] of [[fungi]] within the class [[Sordariomycetes]]. Circumscribed in 2007, it is distinguished from similar fungi by having entirely [[hyaline]] (translucent) vegetative [[hypha]]e, and widely scattered, pimple-shaped denticles (toothlike projections) on the long hyaline [[rachis]]. The generic name derives from a combination of the [[Ancient Greek]] words ''myrmekia'', meaning "wart", and the suffix ''-ridium'' from ''[[Chloridium]]''.<ref name="Arzaniou 2007"/>
